const ExportModal = () => {
	const globalStyles = GlobalStyles();
	const { colors } = useTheme();

	const [isExporting, setIsExporting] = useState(false);
	const [exportStatus, setExportStatus] = useState('');
	const [encryptedData, setEncryptedData] = useState('');
	const [encrypted, setEncrypted] = useState(false);


	const db = useSQLiteContext();

	const copyData = async () => {
		await Clipboard.setStringAsync(encryptedData);
	};

	async function exportDataToExcel() {
		try {
			setIsExporting(true);
			setExportStatus('Fetching data from database...');

			// Get data from SQLite database
			const transactions = await db.getAllAsync<AllDataProps>(`SELECT *
         FROM transactions as t 
         INNER JOIN budgets as b ON t.bdgtId = b.bdgtId 
         INNER JOIN categories as c ON t.categId = c.categId 
         ORDER BY transDate ASC;`).catch((err) => {
				console.log(err);
			});

			if (!transactions || transactions.length === 0) {
				throw new Error('No data found in the app');
			}
			setExportStatus('Creating Excel file...');

			// Encrypt the data
			const key = hmacSHA512(transactions.map(tx => tx.transId?.toString() + "~" + tx.amount.toString() + "~" + tx.bdgtId.toString() + tx.bdgtName.toString()).join('-'), process.env.EXPO_PUBLIC_KEY?.toString()!);
			setEncryptedData(key.toString(Base64));

			setEncrypted(true);


			// Create worksheet from the data
			const worksheet = XLSX.utils.json_to_sheet(transactions);
			// Create workbook and add the worksheet
			const workbook = XLSX.utils.book_new();
			XLSX.utils.book_append_sheet(workbook, worksheet, 'Transactions');

			// Write the workbook to a base64 string
			const wbout = XLSX.write(workbook, { type: 'base64', bookType: 'xlsx' });

			// Create a temporary file path
			const fileName = `finnote-${new Date().toISOString()}.xlsx`;
			const fileUri = FileSystem.documentDirectory + fileName;

			setExportStatus('Saving Excel file...');

			// Write the base64 string to file
			await FileSystem.writeAsStringAsync(fileUri, wbout, {
				encoding: FileSystem.EncodingType.Base64
			});

			// Check if sharing is available
			setExportStatus('Preparing to share...');
			const canShare = await Sharing.isAvailableAsync();

			if (canShare) {
				// Share the Excel file
				await Sharing.shareAsync(fileUri, {
					mimeType: 'application/vnd.openxmlformats-officedocument.spreadsheetml.sheet',
					UTI: 'com.microsoft.excel.xlsx',
					dialogTitle: 'Export Members Data'
				});
				setExportStatus('Excel file exported successfully!');
			} else {
				setExportStatus('Sharing is not available on this device');
			}
		} catch (error) {
			console.error('Error exporting data:', error);
			setExportStatus(`Export failed: ${error}`);
		} finally {
			setIsExporting(false);
		}
	};

	return (
		<SafeAreaView style={globalStyles["container"]}>
			{encrypted ? (
				<View style={{ paddingHorizontal: 20, rowGap: 16, justifyContent: 'center', alignItems: 'center', flex: 1 }}>
					<Text variant="titleLarge" style={{ width: 260 }}>Store this secret key at a safe place. It will be used to restore your excel file data.</Text>
					<Card style={{ alignSelf: 'center', width: 260, height: 260, padding: 16, backgroundColor: colors.elevation.level2 }} elevation={0}>
						<Card.Content>
							<Text style={{ fontSize: 24, fontWeight: 'bold', textAlign: 'justify' }}>{encryptedData}</Text>
						</Card.Content>
					</Card>
					<Button icon={"content-copy"} mode='contained-tonal' onPress={copyData}>Copy</Button>
				</View>
			) : <View style={{ flex: 1 }}>
				<Illustration color={colors.onBackground} />
				<Text variant="titleLarge" >Export your data to an Excel sheet.</Text>
				<Text>This will create an Excel file containing all your expenses data and a Unique key to restore your data in future.</Text>
			</View>}
			{exportStatus ? <Text>{exportStatus}</Text> : null}
			<Button
				onPress={exportDataToExcel}
				disabled={isExporting}
				mode="contained"
			>Export Members to Excel</Button>
		</SafeAreaView>
	)
}

export default ExportModal;